void numberSeqPreInit()
{
    runExecuteDirect   = false;

    numberSequenceModules = [NumberSeqModule::HM];
    numberSeqApplicationModule = new numberSeqModuleHM();
    scope = NumberSeqScopeFactory::createDataAreaScope();
    NumberSeqApplicationModule::createReferencesMulti(numberSequenceModules, scope);
    tmpIdRef.setTmpData(NumberSequenceReference::configurationKeyTableMulti(numberSequenceModules));
}

public void setallowOverBook()
{
        if (HMParameters.OverbookAllowed == NoYes::No)
        {
          HMParameters.NumberOfOverBookings = 0;
          HMParameters_NumberOfOverBookings.enabled(false);
        }
        else
        {
            HMParameters_NumberOfOverBookings.enabled(true);
        }
}

public void storeItem(ItemId _value)
{
    ItemId                  itemId;
    FormControl             stringControl;

    itemId = _value;

    stringControl = this.selectedControl();

    if (stringControl.name() == 'ServicesGroup_DefaultCOPayService')
    {
        HMParameters.DefaultCOPayService = itemId;
        ServicesGroup_DefaultCOPayService.text(HMInventTableClass::showDescription(itemId));
    }
    else if (stringControl.name() == 'ServicesGroup_DefaultDeductibleService')
    {
        HMParameters.DefaultDeductibleService = itemId;
        ServicesGroup_DefaultDeductibleService.text(HMInventTableClass::showDescription(itemId));
    }
}

