public void write()
{
    HMHeaderValue newHeaderValue;
    HMEncryptionPassword newEncrypPassword;
    HMEncryptionParameters  hmEncryptionParametersNew;
    HMEncryptionParameters  hmEncryptionParametersCheck;

    if(HMEncryptionParameters.RecId)
    {
        if(HMEncryptionParameters.HeaderValue != HMEncryptionParameters.orig().HeaderValue)
        {
            select * from hmEncryptionParametersCheck
                where hmEncryptionParametersCheck.HeaderValue == HMEncryptionParameters.HeaderValue;

            if(hmEncryptionParametersCheck.RecId)
            {
                ttsBegin;

                newEncrypPassword = HMEncryptionParameters.EncryptionPassword;
                newHeaderValue = HMEncryptionParameters.HeaderValue;
                HMEncryptionParameters.IsActive = YesNo::No;
                HMEncryptionParameters.HeaderValue = HMEncryptionParameters.orig().HeaderValue;
                HMEncryptionParameters.EncryptionPassword = HMEncryptionParameters.orig().EncryptionPassword;

                super();

                select forUpdate * from hmEncryptionParametersNew
                    where hmEncryptionParametersNew.HeaderValue == newHeaderValue;

                hmEncryptionParametersNew.EncryptionPassword = newEncrypPassword;
                hmEncryptionParametersNew.IsActive = YesNo::Yes;
                hmEncryptionParametersNew.update();

                ttsCommit;
            }
            else
            {
                ttsBegin;

                newEncrypPassword = HMEncryptionParameters.EncryptionPassword;
                newHeaderValue = HMEncryptionParameters.HeaderValue;
                HMEncryptionParameters.IsActive = YesNo::No;
                HMEncryptionParameters.HeaderValue = HMEncryptionParameters.orig().HeaderValue;
                HMEncryptionParameters.EncryptionPassword = HMEncryptionParameters.orig().EncryptionPassword;

                super();

                hmEncryptionParametersNew.initValue();
                hmEncryptionParametersNew.HeaderValue = newHeaderValue;
                hmEncryptionParametersNew.EncryptionPassword = newEncrypPassword;
                hmEncryptionParametersNew.insert();

                ttsCommit;
            }

            HMEncryptionParameters_ds.executeQuery();
        }
        else if(HMEncryptionParameters.EncryptionPassword != HMEncryptionParameters.orig().EncryptionPassword)
        {
            super();
        }
    }
    else
    {
        super();
    }



   // super();
}

