    {
        hmparameters.OfflineAppointments       = real2int(System.Math::Ceiling( hmparameters.PercentOfflineAppointment));
        hmparameters.PercentOnlineAppointment  = 100 - this.realValue();
        hmparameters.OnlineAppointments        = real2int(System.Math::Floor(  hmparameters.PercentOnlineAppointment));
    }
    else
    {
        ret =  checkFailed("@MAZ8620");
        this.setFocus();
    }


