public boolean modified()
{
    boolean ret;

    ret = super();

    if (ret)
    {
        if (this.value() <=  100)
        {
            HMParameters.PercentOfflineAppointment = (HMParameters.OfflineAppointments / 100) * 100;
            HMParameters.PercentOnlineAppointment  = 100 - HMParameters.PercentOfflineAppointment;
            HMParameters.OnlineAppointments        = 100 - this.value();
        }
        else
        {
             ret = checkFailed("@MAZ8620");
             this.setFocus();
        }

    }
    return ret;
}

