public boolean modified()
{
    boolean ret;

    InventTable inventLocal;
    HMlookupClass           HMlookupClassObj = new HMlookupClass();
    ItemId orignal = HMParameters.DefaultCOPayService;

    ret = super();

    if (ret)
    {
        if (this.text() != "")
        {
            inventLocal = HMlookupClassObj.checkValidInventService(this.text());

            if (inventLocal.RecId)
            {
                HMParameters.DefaultCOPayService = inventLocal.ItemId;
            }
            else
            {
                warning(strFmt("@SYS316757","@MAZ672"));
                HMParameters.DefaultCOPayService = orignal;
                this.update();
            }
        }
    }

    return ret;
}

