void clicked()
{
    HMServiceAppHelper  appHelper = new HMServiceAppHelper();
    container           conResponse;

    boolean ret;
    int         containerSize, counter = 3, indexValue;

    str    Token;

    ret = appHelper.callPostWebAPI('api/Authenticate/Login', "{\"UserName\":\""+HMParameters.UserName+"\",\"Password\":\""+HMParameters.Password+"\",\"Domain\":\""+HMParameters.Domain+"\"}"); //+ guid2str(CRMCaseId) + "\",\"currentPage\":\"1\"}");

    if(ret)
    {
        conResponse = appHelper.parmRecordsCon();
    }

    containerSize = conLen(conResponse);

    If (containerSize > 3)
    {
        Token = conPeek(conResponse,conFind(conResponse,"token")+1);
    }
    if (Token)
    {
        HMParameters.Token = Token;
        info("UserName and Password verified");
    }
    else
    {
        info("Token not generated");
    }

    super();
}

