public boolean validate()
{
    boolean ret;
    System.Text.RegularExpressions.Regex    regEx;
    System.Text.RegularExpressions.Match    regMatch;
    FormStringControl                       PPEServiceUrl;

    ret = super();

    //validate through the regular expression
    regEx = new System.Text.RegularExpressions.Regex(strUrlRegEx);
    regMatch = regEx.Match(this.text());
    ret = regMatch.get_Success();
    if (ret==false)
        error("@MAZ4920");
    PPEServiceUrl = this.formRun().design().controlName('HealthVaultEnvironmentURLs_HVaultServicePPEUrl');
    if (PPEServiceUrl)
    {
        if (this.text() == PPEServiceUrl.text())
        {
            error("@MAZ4919");
            ret = false;
        }
    }
    return ret;
}

